export default (props) => {
  return (
    <div>
      <Sparklines width={1000} height={20}
        data={props.data}>
          <SparklinesLine color={props.color}/>
          <SparklinesReferenceLine type="avg"/>
      </Sparklines>

    </div>
  );
};
